import React from 'react'
import "./Filter.css"
import {useState} from 'react'

export default function CheckBoxComponent({value}) {

  const [isChecked,setIsChecked]=useState(false)

  const handleClick=()=>{
    setIsChecked(!isChecked)
  }

  return (
    <div className='checkboxComponentDiv' onClick={handleClick}>
      <input type="checkbox" className='checks' ckecked={isChecked} /><span className='checkboxComponents'>{value}</span>
    </div>
  )
}
